        value:
          "Find a vertical base you can hold on to. This base should be secure and allow you to grip it safely; a doorframe or high railings are excellent potential candidates. Stand close to the base - the tips of your toes should be between three and six inches out. Take hold of the object in a comfortable grip. This is the start position. Allow your bodyweight to shift back by leaning slightly. Extend your arms as you go, until they are very nearly straight, and your body is angled diagonally backwards. This is the finish position. At this point you will feel a gentle stretch in your upper back, and possibly your arms. Pause momentarily before pulling yourself back to the start position, by contracting the shoulder blades and bending the arms simultaneously. Pause and repeat.",
